# Used to load gestures from xml
def loadXMLDataset(xml_folder_path, preprocessor):
    dataset = {}
    xmlReader = XmlGestureReader()
    # Traverse the directory structure of xml_logs
    for user in os.listdir(xml_folder_path):
        # required for mac
        if user == '.DS_Store':
            continue
        userFullDir = os.path.join(xml_folder_path, user)
        for speed in os.listdir(userFullDir):
            # required for mac
            if speed == '.DS_Store':
                continue
            speedDir = os.path.join(userFullDir, speed)
            for gesture in os.listdir(speedDir):
                # required for mac
                if speed == '.DS_Store':
                    continue 
                gesturePath = os.path.join(speedDir, gesture)
                name = user+'-'+gesture
                gesture = xmlReader.readGesture(gesturePath, preprocessor)
                gestureType = gesture.targetLabel
                # Initializing the data stucture that will store all our logs
                if user not in dataset:
                    dataset[user] = {}
                if speed not in dataset[user]:
                    dataset[user][speed] = {}
                if gestureType not in dataset[user][speed]:
                    dataset[user][speed][gestureType] = []
                dataset[user][speed][gestureType].append(gesture)
    return dataset

def loadMmgXMLDataset(xml_folder_path, preprocessor):
    dataset = {}
    xmlReader = xmlMmgGestureReader()
    # Traverse the directory structure of xml_logs
    for sample in os.listdir(xml_folder_path):
        # required for mac
        if sample == '.DS_Store':
            continue
        sampleFullDir = os.path.join(xml_folder_path, sample)
        user, mode, speed = sample.split('-')
        speed = speed.lower()
        for gestureFile in os.listdir(sampleFullDir):
            # required for mac
            if gestureFile == '.DS_Store':
                continue
            fileExtnsion = gestureFile.split('.')[-1]
            if fileExtnsion != 'xml':
                continue
            gesturePath = os.path.join(sampleFullDir, gestureFile)
            # print(gesturePath)
            gesture = xmlReader.readGesture(gesturePath, preprocessor)
            gestureType = gesture.targetLabel
            # Initializing the data stucture that will store all our logs
            if user not in dataset:
                dataset[user] = {}
            if speed not in dataset[user]:
                dataset[user][speed] = {}
            if gestureType not in dataset[user][speed]:
                dataset[user][speed][gestureType] = []
            dataset[user][speed][gestureType].append(gesture)
    return dataset